(23, 'Getting Started with business-supermarket.com', '<p class="p10 ft9" style=" color: rgb(165, 70, 134);  text-align: left; margin-top: 0px; margin-bottom: 0px; white-space: nowrap;">\r\n	&nbsp;</p>\r\n<p class="p10 ft9" style=" color: rgb(165, 70, 134);  text-align: left; margin-top: 0px; margin-bottom: 0px; white-space: nowrap;">\r\n	<span style="font-size:16px;">Getting Started with<span class="Apple-converted-space">&nbsp;</span></span><nobr><span style="font-size:16px;">business-supermarket.com123</span></nobr></p>\r\n<p style="text-align: right;">\r\n	<a href="http://129.121.137.227/~busines2/index.php/site/page/faq"><span style="color:#808080;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Back to contents &gt;&gt;</span></a></p>\r\n<hr />\r\n<p class="p10 ft9" style=" color: rgb(165, 70, 134);  text-align: left; margin-top: 0px; margin-bottom: 0px; white-space: nowrap;">\r\n	&nbsp;</p>\r\n<p class="p10 ft9" style=" color: rgb(165, 70, 134);  text-align: left; margin-top: 0px; margin-bottom: 0px; white-space: nowrap;">\r\n	<span style="font-size:16px;">What is Business-Supermarket.com</span></p>\r\n<p>\r\n	DragonsNet.Biz is setup as a meeting place for both the business and its consumer. This website allows new business ideas to be market tested BEFORE the business su?ers losses for a product that fails to deliver the expected pro?t margin. It does this by allowing the business to get support and a following from the consumer before the idea goes to market. Getting consumer support for a business prior to its launch allows the business to plan a strategy to bring the product to market and supply the demand. The consumer (the general public and the individual) bene?t by becoming part of the next big thing as well as being rewarded with a free entry to the prize draw. See DragonsNet Free Prize Draw for further details.</p>\r\n<p class="p10 ft9" style=" color: rgb(165, 70, 134);  text-align: left; margin-top: 0px; margin-bottom: 0px; white-space: nowrap;">\r\n	<span style="font-size:16px;">Do I need to register?</span></p>\r\n<p>\r\n	In short NO. However you will not be able to take part in our community. You may however navigate the site without restrictions. You will not be able to leave a comment or get free entry to the prize draw.</p>\r\n<p class="p10 ft9" style=" color: rgb(165, 70, 134);  text-align: left; margin-top: 0px; margin-bottom: 0px; white-space: nowrap;">\r\n	<span style="font-size:16px;">What are the bene?ts of becoming a member?</span></p>\r\n<p>\r\n	Membership allows you to take part in the business community and be part of the next industrial revolution. You also get free entry to our monthly prize draw. If you inspire to own your own business then follow the steps needed to get funding from DragonsNet.Biz and make your business idea a reality. Contact DragonsNet for further details.</p>\r\n<p class="p10 ft9" style=" color: rgb(165, 70, 134);  text-align: left; margin-top: 0px; margin-bottom: 0px; white-space: nowrap;">\r\n	<span style="font-size:16px;">What Business Supermarket has to offer if:-<a name="offer-it"></a></span></p>\r\n<p style="color:rgb(165, 70, 134)">\r\n	you are a consumer.</p>\r\n<p>\r\n	<a href="http://youtu.be/YlIhWEhFyE4">View a video presentation here &gt;&gt;</a></p>\r\n<p>\r\n	<span style="color:#33cc00;">Help create a business that caters for your needs.</span></p>\r\n<p>\r\n	If you are a consumer that has no desire to start their own business but feel that you want to be part of the next big thing; then you may take part in the forums for products that are of interest to you. Help the businesses listed here to cater for your needs.</p>\r\n<p>\r\n	<span style="color:#33cc00;">Be inspired to come up with your own business idea.</span></p>\r\n<p>\r\n	Who knows you may even be inspired to come up with a business idea of your own that you could sell or license out with little cost or e?ort on your part. Check out &lsquo; for easy step by step instructions to get started. how to list your business idea&rsquo;</p>\r\n<p>\r\n	<span style="color:#339900;">Be a mentor or become a business partner. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>If you have a skill or a trade that may of use to business ideas listed here, then why not o?er advice or become a mentor for an arranged fee. Earn income while you enjoy exploiting your skill.</p>\r\n<p>\r\n	<span style="color:#33cc00;">Get free entry to our monthly prize draw. &nbsp; &nbsp; &nbsp; &nbsp; </span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;</p>\r\n<p>\r\n	By interacting with other members, taking part in the forums and leaving comments, viewing videos of the business idea, voting etc you are acquiring points which give you free entry to our prize draw. We reward your input and value your opinions. Check out for further details.</p>\r\n<p style="color:rgb(165, 70, 134)">\r\n	you want to start your own business.</p>\r\n<p>\r\n	View a video presentation here &gt;&gt;&gt;</p>\r\n<p>\r\n	<span style="color:#33cc00;">Got a great idea but don&rsquo;t know what to do?</span></p>\r\n<p>\r\n	List your business or business idea here for free and get support from the public and thus the consumer.</p>\r\n<p>\r\n	If you get a positive response then DragonsNet may help fund your idea to make it a reality.</p>\r\n<p>\r\n	<span style="color:#33cc00;">Need help to take your business idea to market?</span></p>\r\n<p>\r\n	If you need help and guidance to bring your business idea to market, then check out our Services section to get in contact with businesses that help guide you into making your idea a reality.</p>\r\n<p>\r\n	<span style="color:#33cc00;">How can DragonsNet.Biz help?</span></p>\r\n<p>\r\n	If your business idea quali?es for funding support from DragonsNet then we will provide a professional management team to ensure that your idea successfully gets to market. If your listings achieves75% or more positive votes then for further details. Our management team will draft up a business growth strategy for contact DragonsNet your business for the next 5 years.</p>\r\n<p>\r\n	<span style="color:#33cc00;">Strengthen your weaknesses</span></p>\r\n<p>\r\n	To succeed you need skill sets that you may not have. Use this website to get the skill set your business needs and free you up to do what you do best. Many members are prepared to o?er help, advice and guidance. Use your to ?nd the right candidate.</p>\r\n<p style="color:rgb(165, 70, 134)">\r\n	you want to earn an income.</p>\r\n<p>\r\n	<a href="http://youtu.be/N65U3m00esw">View a video presentation here &gt;&gt;&gt;</a></p>\r\n<p>\r\n	All the services listed below allow you, the individual, to o?er help and advice to business ideas listed on this website for a fee that can be arranged between you and the lister of the business idea.</p>\r\n<p>\r\n	<span style="color:#33cc00;">Be a teacher.&nbsp;&nbsp;</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n<p>\r\n	We all lack certain skills for which we need advice and guidance. O?er help to businesses that could bene?t from your skill set and advice.</p>\r\n<p>\r\n	<span style="color:#33cc00;">Be a mentor.&nbsp;</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n<p>\r\n	For a fee you could o?er to mentor a business that could bene?t from your skill and experience.</p>\r\n<p>\r\n	<span style="color:#33cc00;">Become a partner.</span></p>\r\n<p>\r\n	Feel that you want to be part of the next bid thing, then o?er to become a partner in a business idea you feel strongly about and enjoy in the rewards o?ered by a successful company.</p>\r\n<p>\r\n	<span style="color:#33cc00;">Enter our Prize Draw.</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n<p>\r\n	Your interaction with this site earns you points and free entry to our monthly prize draw. See for further details.</p>\r\n', 0, 'Getting Started with business-supermarket.com', '\r\nnbsp\r\n\r\nGetting Started withnbspbusiness-supermarketcom123\r\n\r\nnbspnbspnbspnbspnbspnbspnbspnbspnbspnbspnbspnbspnbspnbspnbs', '', 'getting-started-with-business-supermarketcom', 1, 0, '', 0, 0, 0, 1407608221),
