(63, 2, 1, 0, 'Business_supermarket_1442318643.jpg', 'Aequalis software soluations Pvt Ltd', 'It is started in 2010, with the purpose of providing friendly soft', 'Got a great idea? We have the skills and knowledge to help you take it to market and all the steps in between.', 'How do you list my idea?\r\nSee our \'how to\' videos', '1', '', NULL, 'Got a great idea? We have the skills and knowledge to help you take it to market and all the steps in between.', 'knowledge,market,skills', 3, '1', NULL, NULL, NULL, 88, NULL, NULL, NULL, NULL, '2015-09-15', '4', '0000-00-00'),
(64, 2, 1, 100, 'Business_supermarket_1442332199.jpg', 'New Testing', 'New Testing', 'New Testing', 'New Testing', '1', '', NULL, 'New Testing', 'New Testing', 2, '1', NULL, NULL, NULL, 86, NULL, NULL, NULL, NULL, '2015-11-19', '4', '2015-11-26'),
(67, 4, 1, 0, 'Business_supermarket_1443424369.jpg', 'Geventech pvt lmt', 'It is started in 2010, with the purpose of providing friendly soft', 'Just describe your problem; we provide the solution!\r\n\r\nWe do not over-engineer a solution, unless it is a requirement!', 'Our developers have 5000+ man hours of experience in developing web and mobile apps using the apt technology! ', '2', ',,,,,', NULL, 'An Android application to assign Funkytones to phone contacts. ', 'geventech,company,technology', 2, '1', NULL, NULL, NULL, 89, NULL, NULL, NULL, NULL, '2015-11-19', '4', '0000-00-00'),
(68, 3, 2, 2, 'Business_supermarket_1444449329.jpg', 'zx cx c', 'zc xzcz', 'x cxz xzc', 'a da sdas das das sad sad as', '2', '', NULL, 'asd asd sa das', ' dasd sad asd sad asd', NULL, '0', NULL, NULL, NULL, 90, NULL, NULL, NULL, NULL, '2015-11-19', '4', '2015-11-30'),
(71, 2, 1, 1, 'Business_supermarket_1448526950.jpg', 'Drivestop System', 'A security system for the prevention of petrol theft from gas stations', 'A security system that uses patent protected stinger system to immobilize any vehicle by using a controlled deflation of the rear wheels. The offending vehicle will come to rest at a known distance from the point of theft.', 'The company Drivestop Limited first started trading as of 2008. During its first year it achieved 1 forecourt installations in the UK. This was operational on an independent forecourt for a period of 1 year to trial the system. \r\n	During the trial period it achieved 1 drive off that was successfully appended and then zero drive offs for the rest of the year. As a result the police requested demonstration of the system in their workshops and put forward sites with very large drive off issues. \r\n	TV, Radio and forecourt magazine exposure further generated interest in the system to the extent that by the end of 2010 we had 14 successful installations nationwide. Of the 14 three were independent forecourts and the remainder being company owned.\r\n	In 2010 we acquired the contract to install the system at Morrisons Wednesbury. \r\n	After a year of successfully deterring drive-offs from the site we were requested to survey two other sites for installation. However health issues prevented me from doing any further installations and I am now looking for a company / organization to take over the operation and possible take the system worldwide once we have saturated the UK Market.', '', '20000000,22000000,34000000,45000000,65000000,80000000', '1', 'Health issues prevented me from doing any further installations and I am now looking for a company / organisation to take over the operation and possible take the system worldwide once we have saturated the UK Market.\r\n	I would consider licensing the patent or sell the whole operation outright', 'Petrol, theft, stinger, gas station, car, HGV, Tyres, Back axle, rear wheels, puncture, forecourt, fuel, petrol pump', 1, '0', NULL, NULL, NULL, 88, NULL, NULL, NULL, NULL, '', '4', '2015-11-30'),
(80, 2, 2, 100, 'Business_supermarket_1449553447.jpg', 'new testing', 'new testing', 'new testing', 'new testing', '1', '', NULL, 'new testing', 'new testing', NULL, '0', NULL, NULL, NULL, 86, NULL, NULL, NULL, NULL, '', '2', '2015-12-11');
